function Resume() {
  return (
    <div className="resume" id="resume">
      <h1>Resume</h1>
      <iframe
        src="/shiny-octo-pancake-personal-website//myResume.pdf"
        title="PDF Viewer"
      />
    </div>
  );
}

export default Resume;
